import base64

def decode(key, enc):
	dec = []
	enc = base64.urlsafe_b64decode(enc.encode('ascii','ignore'))
	for i in range(len(enc)):
		key_c = key[i % len(key)]
		dec_c = chr((256 + ord(enc[i]) - ord(key_c)) % 256)
		dec.append(dec_c)
	return ''.join(dec)
	
